import React from 'react';

import { Table } from 'react-bootstrap';

const AssetTable = (props) => {
  const data = props.data;
  // let assets = data.map((asset) => (
  //   <AssetRow ticker={asset.ticker} proportion={asset.proportion} />
  // ));
  return (
    <div>
      <Table striped bordered hover>
        <thead>
          <tr>
            <th>Asset Name</th>
            <th>Ticker</th>
            <th>Weight</th>
          </tr>
        </thead>
        <tbody></tbody>
      </Table>
    </div>
  );
};

export default AssetTable;
